INSERT INTO `movies` (`id`, `title`, `description`, `image`, `genre`, `duration`, `director`, `price`) VALUES
(1, 'Летучий корабль', 'Царь собирается выдать свою дочь Забаву за красавца Поля,единственного наследника богача Полкана. Вот только царевна хочет выйти замуж по любви. Ее неожиданное знакомство с простым, но честным и обаятельным матросом Иваном вносит смуту в планы хитреца Поля заполучитькорону. И если в руках злодея темная магия и богатство, то на стороне Ивана – волшебные существа, любовь и мечта.', , 'Сказка', '1 час 40 минут', 'Илья Учитель', '250 рублей');
INSERT INTO `movies` (`id`, `title`, `description`, `image`, `genre`, `duration`, `director`, `price`) VALUES
(3, 'Приключения панды', 'Юный, но отважный панда по имени Пан отправляется в Африку, чтобы спасти свою лучшую подругу — дракона Цзелун. Теперь его ждёт захватывающее путешествие в удивительный для него мир гор, пустынь и джунглей. Полагаясь на свой ум, доброту и находчивость, он заведёт множество новых друзей среди местных обитателей, ведь у храбрости нет размера, а настоящая дружба не знает преград.', , 'Приключения', '1 час 20 минут', 'Рихард Клаус', '300 рублей');
INSERT INTO `movies` (`id`, `title`, `description`, `image`, `genre`, `duration`, `director`, `price`) VALUES
(2, '100 лет тому вперёд', 'Они живут в разных мирах. Коля Герасимов — в сегодняшней Москве, Алиса Селезнева — на сто лет позже. Коля – обычный парень, ему нет дела до будущего. Алису не отпускает прошлое: она должна найти маму, которую потеряла, когда была совсем ребенком. Встреча Алисы и Коли станет началом невероятных приключений, в которых нашим героям предстоит отвоевать у космических пиратов Вселенную, восстановить ход времени и обрести самое дорогое: любовь и дружбу.', , 'Приключения', '2 часа 22 минуты', 'Александр Андрющенко', '280 рублей');
INSERT INTO `movies` (`id`, `title`, `description`, `image`, `genre`, `duration`, `director`, `price`) VALUES
(4, 'Всемирный потоп', 'Дождь льет уже не первый месяц, вода начинает разрушать все на своем пути, объявляется чрезвычайное положение. Когда мир оказывается на грани катастрофы, молодая мать отправляется на поиски безопасного места для своего новорожденного ребенка.', , 'Драма', '1 час 36 минут', 'Махалия Бело', '320 рублей');
INSERT INTO `movies` (`id`, `title`, `description`, `image`, `genre`, `duration`, `director`, `price`) VALUES
(5, 'Любви не бывает', 'Катя полностью разочаровалась в мужчинах. Саша не может и дня прожить без новой женщины. Случайность сделала их соседями, которым не ужиться вместе. Решив перевоспитать самоуверенного бабника, Катя использует все средства, чтобы превратить его жизнь в сущий кошмар. Однако игра с огнем может дорого обойтись, ведь от ненависти до любви – всего один шаг, даже если в любовь не веришь…', , 'Мелодрама', '1 час 45 минут', 'Дмитрий Фикс', '300 рублей');
INSERT INTO `movies` (`id`, `title`, `description`, `image`, `genre`, `duration`, `director`, `price`) VALUES
(6, 'Падение империи', 'Национальная гвардия Калифорнии и Техаса при поддержке боевой техники и авиации штурмуют столицу. Белый дом вот-вот падёт. Группа журналистов пытается добраться до пылающего Вашингтона, чтобы взять последнее интервью у президента некогда Соединённых Штатов Америки. Но в стране, где царит хаос, нет ничего дороже литра бензина и ничего дешевле, чем человеческая жизнь.', , 'Боевик', '1 час 49 минут', 'Алекс Гарленд', '250 рублей');

